import styled from "styled-components";


export const Content = styled.div`
.listItem{
    min-width: 20rem;
    max-width: 20rem;
    min-height: 30rem;
    max-height: 30rem;
    display: inline-block;
    margin:0.8rem;
    text-align: center;
    background-color: rgb(30 54 136 / 13%);
    padding: 2.5rem;
    border-radius: 0.5rem;
    img{
        max-width: 15rem;
        min-width: 15rem;
        min-height: 15rem;
        max-height: 15rem;
        object-fit: cover;
        border-radius: 0.5rem;
    }
    p{
        margin: 0.2rem;
        font-size: 0.9rem;
        font-weight: bold;

    }
    .paragraphData{
        margin-top: 1rem;
    }
    .removeObj{
        background: transparent;
        border:none;
        position: absolute;
        svg{
            width: 1rem;
            height: 1rem;
            fill: red;
            cursor: pointer;
        }
    }
}
`
